import { REQUEST_TYPES_COIN, SET_EMAIL, SET_CURRENCIES } from './actionTypes';

const requestTypesCoin = () => ({
  type: REQUEST_TYPES_COIN,
});

export function saveEmail(email) {
  return {
    type: SET_EMAIL,
    email,
  };
}

export function setCurrencies(coins) {
  return {
    type: SET_CURRENCIES,
    coins,
  };
}
